import React from "react";
import { Container, Row, Col } from "react-bootstrap";
import "../index.css";

class BodyWeightWidget extends React.Component {
  render() {
    return (
      <div>
        <Container>
          <Row>
            {/* Text */}
            <Col></Col>
            {/* Graph */}
            <Col></Col>
          </Row>
        </Container>
      </div>
    );
  }
}

export default class Log extends React.Component {
  constructor() {
    super();
    this.state = {};
  }

  componentDidMount() {
    this.setState({});
  }

  render() {
    return (
      <div
        style={{
          textAlign: "center",
          margin: "auto",
          padding: "30px",
        }}
      >
        <h1 className="header">The Dashboard</h1>
        <p className="header_smaller">
          This page is currently under development.
        </p>
        {/* Training Block Container */}
        <Container>
          <Row>
            {/* SBD deltas col */}
            <Col></Col>
            {/* Training Block summary col */}
            <Col></Col>
            {/* Next meet Col */}
            <Col></Col>
          </Row>
        </Container>
        {/* Training Week Container */}
        <Container>
          <Row>
            <Col></Col>
          </Row>
        </Container>

        {/* Body Weight Container */}
      </div>
    );
  }
}
